import React from 'react';
import { Button, Col, Form, Row } from 'react-bootstrap';

const Volunteer = (props) => {
    const { displayName, enterDate, email, category } = props.reg
    return (
        <div>
            {/* <h6>Name: {displayName} Email: {email} RegisterDate: {enterDate}</h6> */}

            <Row>
                <Col>
                    <Form.Control type="text" value={displayName} />
                </Col>
                <Col>
                    <Form.Control type="text" value={email} />
                </Col>
                <Col>
                    <Form.Control type="text" value={enterDate} />
                </Col>
                <Col>
                    <Form.Control type="text" value={category} />
                </Col>
                <Col>
                    <Button variant="warning">Delete</Button>
                </Col>
            </Row>

        </div>
    );
};

export default Volunteer;
